void makeBoard() {
	int col, row;
    for( col = 0; col < BOARD_DIMENSION; col++) {
        for( row = 0; row < BOARD_DIMENSION; row++) {
            if(row < 2) {
                basemap[col][row].piece.isWhite = false;
                //pawns
                if(row == 1) {
                    basemap[col][row].piece._id = 0; 
                    strcpy(basemap[col][row].piece.name, "bP"); //strcpy( a, "foo" );
                } else {
                    basemap[col][row].piece._id =  col + 1;
                    if(col == 0 || col == 3){
                        strcpy(basemap[col][row].piece.name ,"bR"); 
                    }
                    else if(col == 1){   
                        strcpy(basemap[col][row].piece.name ,"bQ"); 
                    }
                    else if(col == 2){ 
                        strcpy(basemap[col][row].piece.name ,"bK"); 
                    }
                }
            //if row >= 2
            } else {
                basemap[col][row].piece.isWhite = true;
                //pawns
                if(row == 2) {
                    basemap[col][row].piece._id = 0; 
                    strcpy(basemap[col][row].piece.name ,"wP"); 
                } else {
                    basemap[col][row].piece._id = col + 1;
                    if(col == 0 || col == 3)
                        strcpy(basemap[col][row].piece.name ,"wR"); 
                    else if(col == 1)
                        strcpy(basemap[col][row].piece.name ,"wQ"); 
                    else if(col == 2)
                        strcpy(basemap[col][row].piece.name ,"wK"); 
                }
            }
           // Coordinates currCoords = {col, row};
            //basemap[col][row]. = currCoords;
            basemap[col][row].isEmpty = false; 
        }
    }
	cursor.first = 0;
	cursor.second = 3; 
	startPos.first = -1; 
	startPos.second = -1; 
	endPos.first = -1; 
	endPos.second = -1; 
	byte1 = 0;
	byte2 = 0;
	byte3 = 0;

	org.x = -1;
	org.y = -1;
	org.isInit = false;

	dest.x = -1;
	dest.y = -1;
	dest.isInit = false;
}

void appendMove(int col, int row, int pieceType){
	int i;
	for( i=0; i < 16; i++){
		if(basemap[col][row].possMoves[i] <= 0){
			basemap[col][row].possMoves[i] = pieceType;
			return;
		}
	}
}

void clearMoves(){
	int col, row, i;
    for( col = 0; col <4; col++){
        for( row = 0; row<4; row++){
            for( i =0; i < 16; i++) basemap[col][row].possMoves[i] = 0;
        }
    }
}

void possibleMoves(){
	int col, row;
    for( col = 0; col < BOARD_DIMENSION; col++) {
        for( row = 0; row < BOARD_DIMENSION; row++) {
			Piece currPiece = basemap[col][row].piece;
			//int pieceType = (currPiece._id  + 1) + (currPiece.isWhite * 4);
			//if piece is a pawn
			if(currPiece._id  == 0){
				//move up or down depending on the piece color
				int temprow = row + (2 * !currPiece.isWhite - 1);
				if(temprow >= 0 && temprow < BOARD_DIMENSION){
					if(basemap[col][temprow].isEmpty){
						appendMove(col, temprow, currPiece.uniqueID);
					}
					//llook right
					int tempcol = col + 1; 
					if(!(basemap[tempcol][temprow].isEmpty) && 
					(basemap[tempcol][temprow].piece.isWhite != currPiece.isWhite) &&
					tempcol < BOARD_DIMENSION)
						appendMove(tempcol, temprow, currPiece.uniqueID);
					//lookleft
					tempcol = col - 1; 
					if(!(basemap[tempcol][temprow].isEmpty) && 
					(basemap[tempcol][temprow].piece.isWhite != currPiece.isWhite) && 
					tempcol >= 0)
						appendMove(tempcol, temprow, currPiece.uniqueID);	
				}
			}
			//IF PIECE IS A ROOK
			if(currPiece._id == 1){
				int temprow = row + 1; 
				while (temprow < BOARD_DIMENSION){
					if (basemap[col][temprow].isEmpty)
						appendMove(col, temprow, currPiece.uniqueID); 
					else if(basemap[col][temprow].piece.isWhite != currPiece.isWhite){
						appendMove(col, temprow, currPiece.uniqueID);
						break;
					}
                    else break; 
					temprow += 1;
				}
				temprow = row - 1; 
				while (temprow >= 0){
					if (basemap[col][temprow].isEmpty)
						appendMove(col, temprow, currPiece.uniqueID); 
					else if(basemap[col][temprow].piece.isWhite != currPiece.isWhite){
						appendMove(col, temprow, currPiece.uniqueID);
						break;
					}
                    else break; 
					temprow-=1;
				}
				
				int tempcol = col + 1; 
				while (tempcol < BOARD_DIMENSION){
					if (basemap[tempcol][row].isEmpty)
						appendMove(tempcol, row, currPiece.uniqueID); 
					else if(basemap[tempcol][row].piece.isWhite != currPiece.isWhite){
						appendMove(tempcol, row, currPiece.uniqueID);
                        printf("moving %d, dest %d\n", currPiece.isWhite, basemap[tempcol][row].piece.isWhite);
						break;
					}
                    else break; 
					tempcol += 1;
				}
				tempcol = col -1; 
				while (tempcol >= 0){
					if (basemap[tempcol][row].isEmpty)
						appendMove(tempcol, row, currPiece.uniqueID); 
					else if(basemap[tempcol][row].piece.isWhite != currPiece.isWhite){
						appendMove(tempcol, row, currPiece.uniqueID);
						break;
					}
                    else break; 
					tempcol-=1;
				}
			}
			//IF PIECE IS A QUEEN
			if(currPiece._id == 2){
				//look in all 8 directions
				int i;
				for( i = 0; i < 8; i++){
					int temprow = row + round(sin(i*3.14/4));
					int tempcol = col + round(cos(i*3.14/4)); 
					while(temprow >= 0 && tempcol >=0  && tempcol < BOARD_DIMENSION && temprow < BOARD_DIMENSION){
						if (basemap[tempcol][temprow].isEmpty)
							appendMove(tempcol, temprow, currPiece.uniqueID); 
						else if(basemap[tempcol][temprow].piece.isWhite != currPiece.isWhite){
						    appendMove(tempcol, temprow, currPiece.uniqueID);
							break;

						}
						temprow += round(sin(i*3.14/4));
						tempcol += round(cos(i*3.14/4)); 
					}
				}
			}

			//IF PIECE IS A King
			if(currPiece._id == 3){
				//look in all 8 directions
				int i;
				for(i = 0; i < 8; i++){
					int temprow = row + round(sin(i*3.14/4));
					int tempcol = col + round(cos(i*3.14/4)); 
					if(temprow >= 0 && tempcol >=0  && tempcol < BOARD_DIMENSION && temprow < BOARD_DIMENSION){
						if (basemap[tempcol][temprow].isEmpty)
							appendMove(tempcol, temprow, currPiece.uniqueID); 
						else if(basemap[tempcol][temprow].piece.isWhite != currPiece.isWhite){
							appendMove(tempcol, temprow, currPiece.uniqueID);
						}
					}
				}
			}

		}
	}
}


bool moveMade(){
	//mapSpot startSpot = basemap[startPos.first][startPos.second];
	if(org.x == -1 || org.y == -1) return false; 


	if (basemap[org.x][org.y].isEmpty == true) return false; 
    if (basemap[org.x][org.y].piece.isWhite != whiteTurn) return false; 

	Piece selectedPiece = basemap[org.x][org.y].piece; 
    printf("Selected Piece: %s\n", selectedPiece.name);
	//int pieceType = (selectedPiece._id +1) * (selectedPiece.isWhite + 1);

	bool legalMove; 
	//mapSpot endSpot = basemap[endPos.first][endPos.second]; 
	int i;
	for( i = 0; i < 16; i++){
       // printf("Start Piece Num %d, End Piece Num %d\n", pieceType, endSpot.possMoves[i]);
		if( basemap[dest.x][dest.y].possMoves[i] == selectedPiece.uniqueID){
			legalMove = true; 

			basemap[org.x][org.y].isEmpty = true; 
            Piece endPiece = basemap[dest.x][dest.y].piece; 
            if(endPiece._id == 3){
                printf("GAME OVER!\n");
                if(endPiece.isWhite) whiteWin = true;
                else blackWin = true;
               
            }

			basemap[dest.x][dest.y].piece = selectedPiece; 
			basemap[dest.x][dest.y].isEmpty = false; 



            printf("Valid Move\n");
            break;
		}
	}
    if(legalMove)return true; 
    else return false;
}

void enterPressed(){
	if(startPos.first == -1){
		startPos.first = cursor.first;
		startPos.second = cursor.second;
	}  else if	(endPos.first == -1){
		endPos.first = cursor.first;
		endPos.second = cursor.second; 
	}	

}

int main(){
	printf("the program has started");



	disable_A9_interrupts(); // disable interrupts in the A9 processor
    set_A9_IRQ_stack();
    config_GIC();
    config_KEYs();
	config_PS2();
	// initialize the stack pointer for IRQ mode
	// configure the general interrupt controller
	// configure pushbutton KEYs to generate interrupts
    enable_A9_interrupts(); // enable interrupts in the A9 processor 


    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
     *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	makeBoard();

    while(1){
        //insert what to draw on the screen here
		// printf("Byte2: %d  Byte3: %d", byte2, byte3);
		if(whiteWin || blackWin) {
			draw_winScreen(); 
			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
			continue;
		}
		clear_screen();
        draw_board();
		selBoxDraw(cursor.first, cursor.second); 
		printf("cursor x: %d, cursor y: %d\n", cursor.first, cursor.second);
		clearMoves();
		if(org.y != -1) selectedBoxDraw(org.x, org.y);
		int x, y;
		for(x = 0; x < 4; x++){
            for(y = 0; y < 4; y++){
				if (!basemap[x][y].isEmpty)
            		draw_piece((basemap[x][y].piece), x, y); 
            }
        }
		//insert way to fill start & end positions
		bool validMove = false;
		if(org.isInit && dest.isInit){
			validMove = moveMade(); 
			org.x = -1;
			dest.x = -1;
			org.y = -1;
			dest.y = -1;
			org.isInit = false; 
			dest.isInit = false; 
		}
		if(validMove){ 
			whiteTurn = !whiteTurn;
			dest.x = -1; 
			dest.y = -1;
			org.x = -1; 
			org.y = -1; 
		} 


		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    } 
	return 0;
}

